// src/components/TourCard.js
import React from 'react';
import { Link } from 'react-router-dom';

const TourCard = ({ tour }) => {
  return (
    <div className="tour-card">
      <h3>{tour.title}</h3>
      <p>{tour.shortDescription}</p>
      <Link to={`/tour/${tour.id}`}>View Details</Link>
    </div>
  );
};

export default TourCard;
